        while (i < n1) {
            arr[k] = L[i];
            i++;
            k++;
        }

        // Copy the remaining elements of R[], if any
        // This loop executes only if the left subarray (L) ran out of elements first.
        while (j < n2) {
            arr[k] = R[j];
            j++;
            k++;
        }
    }

