     * Main function that sorts arr[l..r] using mergeSort.
     *
     * @param arr The array to be sorted.
     * @param l   The starting index of the subarray to sort.
     * @param r   The ending index of the subarray to sort.
     */
    public static void mergeSort(int[] arr, int l, int r) {
        // Base case: If the subarray has 0 or 1 element, it's already sorted.
        if (l < r) {
            // Find the middle point to divide the array into two halves.
            // Using l + (r - l) / 2 avoids potential integer overflow
            // that might occur with (l and r are very large).
            int m = l + (r - l) / 2;

            // Recursively sort the first half
            mergeSort(arr, l, m);
            // Recursively sort the second half
            mergeSort(arr, m + 1, r);

            // Merge the two sorted halves
            merge(arr, l, m, r);
        }
    }

